import React, { useEffect, useState } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import useGenerateProposals from '../../hooks/useGenerateProposals';
import './TeamPage.css';
import useRoom from '../../hooks/useRoom';

const TeamPage = () => {
  const navigate = useNavigate();
  const { roomId } = useParams();
  const { fetchTeams } = useRoom();
  const { generateProposals, isGeneratingProposals } = useGenerateProposals();

  const [teams, setTeams] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadTeams = async () => {
      try {
        const teamData = await fetchTeams(roomId);
        setTeams(teamData || []);
      } catch (err) {
        console.error('Error loading teams:', err);
      } finally {
        setLoading(false);
      }
    };
    loadTeams();
  }, [roomId, fetchTeams]);

  return (
    <div className="room-page">
      <div className="room-header">
        <div className="header-content">
          <div className="room-info">
            <h1>Research Teams</h1>
            <p className="creator-info">
              {teams.length} {teams.length === 1 ? 'team' : 'teams'} formed
            </p>
          </div>
          <div className="header-actions">
            <button onClick={() => navigate('/')} className="secondary-button">
              ‚Üê Back to Home
            </button>
          </div>
        </div>
      </div>

      <div className="content-container">
        {loading ? (
          <div className="loading-rooms">
            <div className="spinner"></div>
            <p>Loading teams...</p>
          </div>
        ) : teams.length === 0 ? (
          <div className="empty-state">
            <div className="empty-icon">
              <span role="img" aria-label="Team">üë•</span>
            </div>
            <h3>No Teams Available</h3>
            <p>Generate teams from researcher profiles to get started</p>
            <button onClick={() => navigate(`/room/${roomId}/profiles`)} className="primary-button">
              View Profiles
            </button>
          </div>
        ) : (
          <>
            <div className="profile-grid">
              {teams.map((team) => (
                <div className="profile-card" key={team.team_id}>
                  <div className="card-header">
                    <h3>Team {team.team_id}</h3>
                    <span className="email-badge">
                      {team.team_size} member{team.team_size !== 1 ? 's' : ''}
                    </span>
                  </div>
                  <div className="card-body">
                    <h4 className="section-title">Research Focus:</h4>
                    <div className="topics-container">
                      {team.team_research_areas.map((area, idx) => (
                        <span key={idx} className="topic-tag">{area}</span>
                      ))}
                    </div>

                    <h4 className="section-title" style={{ marginTop: '1rem' }}>Members:</h4>
                    <div className="members-list">
                      {team.members.map((member, idx) => (
                        <div key={idx} className="member-item">
                          <div className="member-name">{member}</div>
                          <div className="member-topics">
                            {team.member_fields[member].map((field, i) => (
                              <span key={i} className="field-tag">{field}</span>
                            ))}
                          </div>
                        </div>
                      ))}
                    </div>
                  </div>
                </div>
              ))}
            </div>

            <div className="generate-teams-container">
              <button
                className="generate-teams-btn"
                onClick={() => generateProposals(roomId)}
                disabled={isGeneratingProposals || teams.length === 0}
              >
                {isGeneratingProposals ? (
                  <>
                    <span className="loading-spinner"></span> Generating Proposals...
                  </>
                ) : (
                  'Generate Research Proposals'
                )}
              </button>
            </div>
          </>
        )}
      </div>
    </div>
  );
};

export default TeamPage;
